import React from "react";
import Header from "./Header";
import { useLocation } from "react-router";

function OweLend(){
    const location = useLocation();

    return(
        <div>
            <Header state = {location.state}/>
            <div class="main-section">

                <h1>Owe/Lend</h1>
                <h4>Owe</h4>

                <h4>Lend</h4>
            </div>
        </div>
    )
}

export default OweLend;
